var gsockets={socket:{},connect:function(e,t){e=e||location.origin;t=t?":"+t:"";this.socket=io.connect(e+t);this.socket.on("connected",function(e){this.id=e.socketID;console.log("gsockets id: "+this.id)})},on:function(e,t){this.socket.on(e,t)},onDisconnect:function(e){this.socket.on("gsockets_disconnect",e)},announce:function(e,t){this.socket.emit("gsockets_announce",{event:e,data:t})},bounce:function(e,t){this.socket.emit("gsockets_bounce",{event:e,data:t})},send:function(e,t,n){this.socket.emit("gsockets_send",{event:t,data:n,socketID:e})},broadcast:function(e,t){this.socket.emit("gsockets_broadcast",{event:e,data:t})},roomAnnounce:function(e,t,n){this.socket.emit("gsockets_roomAnnounce",{event:t,data:n,roomName:e})},roomBroadcast:function(e,t,n){this.socket.emit("gsockets_roomBroadcast",{event:t,data:n,roomName:e})},join:function(e,t){this.socket.emit("gsockets_join",{event:t,roomName:e})},leave:function(e,t){this.socket.emit("gsockets_leave",{event:t,roomName:e})}}